// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Interface para o contrato ERC-20
interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
}

contract Bet {
    address public owner;
    uint256 public totalBetValue;
    uint256 public totalBetAmount;

    IERC20 public token;  // Endereço do contrato do token

    struct Player {        
        address addressPlayer;
        uint256 scoreTeam1;
        uint256 scoreTeam2;
        uint256 betValue;
    }  

    Player[] public playerBets;

    modifier isOwner() {
        require(msg.sender == owner, "Somente o owner pode chamar esse metodo!");
        _;
    }

    event Winner(address indexed addressPlayer, uint256 valueToPay);

    constructor(IERC20 _token) {
        owner = msg.sender; 
        token = _token;
        totalBetValue = 0;
        totalBetAmount = 0;      
    }

    function bet(uint256 _scoreTeam1, uint256 _scoreTeam2) public payable {
        require(msg.value > 0, "Valor da aposta deve ser maior que zero");

        totalBetAmount++; 
        uint256 betValue = msg.value;
        playerBets.push(Player(msg.sender, _scoreTeam1, _scoreTeam2, betValue));

        totalBetValue += betValue;
    }

    function payWinners(uint256 _scoreTeam1, uint256 _scoreTeam2) public isOwner {                  
        for (uint i = 0; i < playerBets.length; i++) {
            if (playerBets[i].scoreTeam1 == _scoreTeam1 && playerBets[i].scoreTeam2 == _scoreTeam2) {
                uint256 valueToPay = (playerBets[i].betValue * totalBetValue) / totalBetAmount;

                require(token.balanceOf(address(this)) >= valueToPay, "Saldo insuficiente");

                token.transfer(playerBets[i].addressPlayer, valueToPay);
                emit Winner(playerBets[i].addressPlayer, valueToPay); 
            }
        }                      
    }

    // Função para depositar tokens no contrato
    function depositTokens(uint256 amount) public isOwner {
        require(token.transferFrom(msg.sender, address(this), amount), "Falha na transferencia de tokens");
    }
}

